            }
        }

        incrementCount=()=>{
            this.setState({count: this.state.count + 1});
        }
        render() {
            return <WrappedComponent name="Madhuri" count={this.state.count} incrementCount={this.incrementCount} />;
        }
    }
    return NewComponent
}

